import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function DetailPage(props) {
  let { id } = useParams();
  const [list, setList] = useState([]);
  return (
    <>
      {props.board.id}
      {props.board.name}
      {props.board.title}
      {props.board.skill_stack}
      {props.board.work_field}
      {props.board.max_people}
      {props.board.end_date}
      {props.board.content}
      {props.board.create_date}
    </>
  );
}

export default DetailPage;
